import { React ,useState ,useEffect} from 'react'
import "./Add.css"
import axios from 'axios'
function Add() {
  const [value,setValue] =useState("")
  let [movies ,setArr] = useState([])
  useEffect( ()=>{
axios.get(`http://www.omdbapi.com/?s=${value} man&apikey=cddd6b3b`)
.then(res =>{
  let m =res.data.Search
  setArr(m)
})
  },[value])
  return (
    <div className='container'>

      <div className="input">
        <input type="text" placeholder=' enter movie name'  value={value} onChange={(e) =>{ setValue(e.target.value)}}/>
      </div>
      <div className="results">
  <ul>
  {movies.forEach(el => <li>{el.title}</li>)}
  </ul>
  
      </div>
    </div>
  )
}

export default Add
